import React from 'react';
import Navbar from './Component/navBar'
import Home from './Component/home'
import {BrowserRouter as Router, Route} from 'react-router-dom'

function App() {

  return (
    <Router>
      <NavBar/>
      <Route exact path ="/" component = {Home}/>
    </Router>

  );
}

export default App;
